@import url("https://fonts.googleapis.com/css2?family=Montserrat:wght@300;400;700&display=swap");
@font-face {
  font-family: LemonMilk;
  src: url(/511447c3d34b9eb973b7edcb7137b70e.otf);
}
/*
font-family: 'Montserrat', sans-serif;
font-family: 'LemonMilk', sans-serif;
*/
* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
  scroll-behavior: smooth;
  line-height: 1.5em;
}
header {
  position: fixed;
  top: 0;
  z-index: 999;
  width: 100%;
  font-family: "Montserrat", sans-serif;
  color: #736969;
  padding: 30px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  transition: padding 300ms;
  opacity: 1;
}
header #header-ip {
  transition: 200ms;
}
header #hamburger {
  transition: 200ms;
}
header #hamburger span {
  display: block;
  height: 3px;
  width: 27px;
  margin: 5px;
  background: #201e1e;
  transition: 200ms;
}
header #hamburger.scrolling span {
  background: #ebe8e8;
}
header #hamburger.active {
  transform: translateX(-140px);
}
header #hamburger.active span:nth-child(1) {
  transform: translateY(8px) rotate(45deg);
}
header #hamburger.active span:nth-child(2) {
  opacity: 0;
}
header #hamburger.active span:nth-child(3) {
  transform: translateY(-8px) rotate(-45deg);
}
header nav {
  height: 100vh;
  width: 140px;
  position: fixed;
  top: 0;
  right: 0;
  background: #403b3b;
  display: flex;
  align-items: center;
  justify-content: flex-start;
  flex-direction: column;
  padding: 0px;
  transition: 200ms;
  transform: translateX(140px);
}
header nav a {
  font-family: "Montserrat", sans-serif;
  text-decoration: none;
  color: #ebe8e8;
  font-size: 20px;
  padding: 20px;
  margin: 0px;
  transition: 200ms;
  width: 100%;
}
header nav a:hover {
  background: #201e1e;
}
header nav.active {
  transform: translateX(0px);
}

#topButton {
  position: fixed;
  bottom: 15px;
  right: 15px;
  z-index: 1000;
  background: #201e1e;
  border-radius: 10px;
  z-index: 998;
  cursor: pointer;
  transition: 200ms;
  transform: translateY(100px);
}
#topButton i {
  color: #ebe8e8;
  padding: 12px;
}
#topButton.active {
  transform: translateY(100px) translateX(-140px);
}

#landing {
  display: flex;
}
#landing .left {
  height: 100vh;
  /* min-height: 845px; */
  width: 50%;
  background: #ebe8e8;
  position: relative;
  font-family: "Montserrat", sans-serif;
  color: #736969;
  display: flex;
  align-items: center;
  justify-content: center;
}
#landing .left .content {
  width: 80%;
  margin: 0 auto;
}
#landing .left .content h1 {
  color: #403b3b;
  font-size: 7vw;
  font-family: "LemonMilk", sans-serif;
}

/* to disable the purity spacing remove from here */
#landing .left .content h1 span {
	letter-spacing: 1.1vw;
}
/* to here */

#landing .left .content hr {
  height: 3px;
  border: none;
  background: #736969;
}
#landing .left .content h2 {
  font-weight: 300;
  font-size: 1.8em;
}
#landing .left .content h2:last-of-type {
  padding-top: 60px;
}
#landing .left #socials {
  position: absolute;
  bottom: 20px;
  right: 30px;
  font-size: 40px;
}
#landing .left #socials a {
  margin: 0 5px;
  color: #403b3b;
  text-decoration: none;
  transition: 300ms;
}
#landing .left #socials #discord:hover {
  color: #7289da;
}
#landing .left #socials #wiki:hover {
  color: #00d5d5;
}
#landing .left #socials #twitter:hover {
  color: #55abee;
}
#landing .left #socials #reddit:hover {
  color: #ff3f18;
}
#landing .left #socials #instagram:hover {
  color: #d82e7a;
}
#landing .right {
  height: 100vh;
  /* min-height: 845px; */
  width: 50%;
}
#landing .right .slider {
  width: 100%;
  height: 100%;
  overflow: hidden;
  position: relative;
}
#landing .right .slider .slides {
  width: 100%;
  height: 500%;
  display: flex;
  flex-direction: column;
}
#landing .right .slider .slides input {
  display: none;
}
#landing .right .slider .slides .slide {
  width: 100%;
  height: 100vh;
  /* min-height: 845px; */
  transition: margin 2s;
  position: relative;
}
#landing .right .slider .slides .slide .bottom {
  width: 100%;
  background: rgba(32, 30, 30, 0.85);
  position: absolute;
  bottom: 0;
  font-family: "Montserrat", sans-serif;
  color: #ebe8e8;
  padding: 30px;
}
#landing .right .slider .slides .slide .bottom h1 {
  font-size: 2em;
  padding-bottom: 10px;
}
#landing .right .slider .slides .slide .bottom p {
  font-size: 16px;
}
#landing .right .slider .slides #slide1 {
  background: url("/e287297b861713546b89d76fd6a2adc4.jpg");
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
}
#landing .right .slider .slides #slide2 {
  background: url("/0093bbf62cf96bdd69ebcf1722ffedd5.jpg");
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
}
#landing .right .slider .slides #slide3 {
  background: url("/412f544656018174f27eac5e2aaf3ea9.jpg");
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
}
#landing .right .slider .slides #slide4 {
  background: url("/78a41a522416a549bf21619e5987fdce.jpg");
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
}
#landing .right .slider .slides .nav-auto {
  position: absolute;
  left: 10px;
  top: 50%;
  display: flex;
  flex-direction: column;
}
#landing .right .slider .slides .nav-auto div {
  border: 2px solid #ebe8e8;
  padding: 5px;
  border-radius: 10px;
  transition: background 300ms;
  margin-bottom: 15px;
}
#landing .right .slider .slides .nav-auto div:hover {
  background: #ebe8e8;
}
#landing .right .slider .nav-manual {
  position: absolute;
  left: 10px;
  top: 50%;
  display: flex;
  flex-direction: column;
}
#landing .right .slider .nav-manual .manual-btn {
  border: 2px solid #ebe8e8;
  padding: 5px;
  border-radius: 10px;
  cursor: pointer;
  transition: background 300ms;
  margin-bottom: 15px;
}
#landing .right .slider .nav-manual .manual-btn:hover {
  background: #ebe8e8;
}
#landing .right .slider #radio1:checked ~ .first {
  margin-top: 0;
}
#landing .right .slider #radio2:checked ~ .first {
  margin-top: -100vh;
}
#landing .right .slider #radio3:checked ~ .first {
  margin-top: -200vh;
}
#landing .right .slider #radio4:checked ~ .first {
  margin-top: -300vh;
}
#landing .right .slider #radio1:checked ~ .nav-auto .auto-btn1 {
  background: #ebe8e8;
}
#landing .right .slider #radio2:checked ~ .nav-auto .auto-btn2 {
  background: #ebe8e8;
}
#landing .right .slider #radio3:checked ~ .nav-auto .auto-btn3 {
  background: #ebe8e8;
}
#landing .right .slider #radio4:checked ~ .nav-auto .auto-btn4 {
  background: #ebe8e8;
}

#about #about-scroll {
  transform: translateY(-49px);
  position: relative;
}
#about h1 {
  padding: 10px 0;
  background: #403b3b;
  color: #ebe8e8;
  text-align: center;
  font-family: "LemonMilk", sans-serif;
  font-size: 62px;
}
#about .split {
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  background: #dedcdc;
}
#about .split:nth-child(odd) {
  background: #d7d5d5;
}
#about .split .image {
  width: 50%;
  height: 400px;
}
#about .split .image.first {
  background: url("/e4b5035f198e546fc6dcc7a507c79a91.jpg");
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;
}
#about .split .image.second {
  background: url("/2fe4efb992957593686b43ac038d15f6.png");
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;
}
#about .split .image.third {
  background: url("/fed1d8c900940c6932867330317859a9.jpg");
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;
}
#about .split p {
