}

#rules {
  background: #201e1e;
  text-align: center;
  font-family: "Montserrat", sans-serif;
  color: #ebe8e8;
}
#rules #rules-scroll {
  transform: translateY(-49px);
  position: relative;
}
#rules h1 {
  font-family: "LemonMilk", sans-serif;
  font-size: 62px;
  padding-top: 20px;
}
#rules h2 {
  font-size: 20px;
  padding: 30px;
  color: #fcd770;
}
#rules .icons {
  display: flex;
  flex-direction: row;
  justify-content: space-evenly;
  align-items: flex-start;
  background: #434040;
  padding: 30px;
}
#rules .icons .card i {
  padding-bottom: 30px;
  font-size: 64px;
  color: #497a95;
}
#rules .icons .card p {
  font-weight: bold;
