}

#ip {
  background: #497a95;
  padding: 30px;
  text-align: center;
  font-family: "Montserrat", sans-serif;
  font-size: 20px;
  color: #ebe8e8;
}
#ip h2 {
  font-size: 28px;
}
#ip input {
  margin: 20px 0;
  padding: 10px;
  font-size: 20px;
  border: none;
  color: #201e1e;
  background: #ebe8e8;
}
#ip button {
  padding: 10px;
  font-size: 20px;
  border: none;
  color: #ebe8e8;
  background: #434040;
}
#ip button i {
  color: #fcd770;
}
#ip button.copied i {
  color: #34df34;
}
#ip p {
  opacity: 0;
}

#donate {
  display: flex;
  height: 80vh;
  min-height: 945px;
}
#donate #donate-scroll {
  transform: translateY(-49px);
  position: relative;
}
#donate .left {
  width: 50%;
  background: #201e1e;
  font-family: "Montserrat", sans-serif;
  color: #ebe8e8;
}
#donate .left h1 {
  font-family: "LemonMilk", sans-serif;
  font-size: 62px;
  text-align: center;
  color: #fcd770;
  padding: 80px 0;
}
#donate .left p {
  font-size: 16px;
  line-height: 2em;
  padding: 10px 60px;
}
#donate .left a {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 300px;
  margin: 80px auto;
  padding: 15px;
  background: #434040;
  color: #ebe8e8;
  text-decoration: none;
}
#donate .left a i {
  margin-right: 30px;
}
#donate .right {
  width: 50%;
  padding: 30px;
  background: url("/1377d14b71d3d5e93c33aabbc142f8eb.jpg");
  background-size: cover;
  background-repeat: no-repeat;
  display: flex;
  justify-content: space-evenly;
  flex-direction: column;
}
#donate .right #silver {
  background: rgba(232, 232, 232, 0.65);
}
#donate .right #gold {
  background: rgba(231, 227, 78, 0.65);
}
#donate .right #platinum {
  background: rgba(62, 224, 218, 0.65);
}
#donate .right #ultimate {
  background: rgba(196, 49, 229, 0.65);
}
#donate .right #prestige {
  background: rgba(229, 49, 49, 0.65);
}
#donate .right .card {
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  position: relative;
  cursor: pointer;
  font-family: "Montserrat", sans-serif;
  color: #ebe8e8;
  height: 120px;
  font-weight: bold;
  font-size: 32px;
  padding: 0 30px;
  overflow: hidden;
}
#donate .right .card .hover {
  position: absolute;
  bottom: -100%;
  left: 0;
  width: 100%;
  height: 100%;
  background: #434040;
  transition: 200ms;
  padding: 20px;
  line-height: 1.5em;
  font-size: 20px;
}
#donate .right .card:hover .hover {
  bottom: 0;
}

#vote {
  font-family: "Montserrat", sans-serif;
  background: #ebe8e8;
}
#vote #vote-scroll {
  transform: translateY(-49px);
  position: relative;
}
#vote h1 {
  color: #497a95;
  font-family: "LemonMilk", sans-serif;
  text-align: center;
  font-size: 62px;
  padding-top: 20px;
}
#vote h2 {
  font-size: 16px;
  margin: 0 auto;
  padding: 30px 10%;
  text-align: center;
  color: #403b3b;
}
#vote h2:last-of-type {
  background: #434040;
  color: #ebe8e8;
}
#vote .content {
  background: #d4d3d3;
  display: flex;
  justify-content: space-evenly;
  padding: 30px;
}
#vote .content section {
  text-align: center;
}
#vote .content section h3 {
  font-size: 36px;
  padding: 30px 0;
  color: #403b3b;
}
#vote .content section .wrapper {
  display: grid;
}
#vote .content section .wrapper .card {
  margin: 10px;
  width: 370px;
  height: 70px;
  display: flex;
  align-items: center;
  justify-content: center;
  color: #ebe8e8;
}
#vote .content section .wrapper .card .right,
#vote .content section .wrapper .card .left {
  width: 50%;
  height: 100%;
  padding: 10px;
  display: flex;
  align-items: center;
  justify-content: flex-start;
  text-align: center;
}
#vote .content section .wrapper .card h4 {
  font-size: 26px;
}
#vote .content section .wrapper .card img {
  padding-right: 10px;
}
#vote .content section.links .wrapper .card {
  background: #497a95;
}
#vote .content section.links .wrapper .card a {
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
  height: 100%;
  color: #ebe8e8;
  text-decoration: none;
  padding: 10px;
  font-weight: bold;
  font-size: 20px;
}
#vote .content section.recurring .wrapper {
  grid-template-columns: repeat(2, 1fr);
}
#vote .content section.recurring .wrapper .card {
  background: #828181;
}
#vote .content section.recurring .wrapper .card .left {
  background: #201e1e;
}
#vote .content section.one-time .wrapper .card {
  color: #403b3b;
  background: #dedcdc;
}
#vote .content section.one-time .wrapper .card .left {
  background: #fcd770;
}

footer {
  background: #201e1e;
  color: #ebe8e8;
  font-family: "Montserrat", sans-serif;
  font-size: 16px;
  text-align: center;
  padding: 20px 0 220px 0;
}
footer p {
  margin: 15px 0;
}
footer a {
