}

#stats #nav-header #hamburger span {
	background: #ebe8e8;
}

#stats h1 {
	color: #ebe8e8;
	background: #434040;
	padding-left: 10px;
	padding-top: 49px;
	font-family: 'LemonMilk', sans-serif;
	font-size: 62px;
}

