  #donate {
    flex-direction: column;
    height: auto;
  }
  #donate .right,
#donate .left {
    width: 100%;
  }
  #donate .right {
    align-items: center;
  }
  #donate .right .card {
    margin: 15px 0;
  }
  #donate .right .card p {
    font-size: 28px;
  }
  #donate .right .card .hover p {
    font-size: 12px;
  }
}
