@import url("https://fonts.googleapis.com/css2?family=Montserrat:wght@300;400;700&display=swap");
@font-face {
  font-family: LemonMilk;
  src: url(../fonts/LEMONMILK-Bold.otf);
}
/*
font-family: 'Montserrat', sans-serif;
font-family: 'LemonMilk', sans-serif;
*/
* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
  scroll-behavior: smooth;
  line-height: 1.5em;
}
header {
  position: fixed;
  top: 0;
  z-index: 999;
  width: 100%;
  font-family: "Montserrat", sans-serif;
  color: #736969;
  padding: 30px;
  display: flex;
  justify-content: space-between;
  align-items: center;
  transition: padding 300ms;
  opacity: 1;
}
header #header-ip {
  transition: 200ms;
}
header #hamburger {
  transition: 200ms;
}
header #hamburger span {
  display: block;
  height: 3px;
  width: 27px;
  margin: 5px;
  background: #201e1e;
  transition: 200ms;
}
header #hamburger.scrolling span {
  background: #ebe8e8;
}
header #hamburger.active {
  transform: translateX(-140px);
}
header #hamburger.active span:nth-child(1) {
  transform: translateY(8px) rotate(45deg);
}
header #hamburger.active span:nth-child(2) {
  opacity: 0;
}
header #hamburger.active span:nth-child(3) {
  transform: translateY(-8px) rotate(-45deg);
}
header nav {
  height: 100vh;
  width: 140px;
  position: fixed;
  top: 0;
  right: 0;
  background: #403b3b;
  display: flex;
  align-items: center;
  justify-content: flex-start;
  flex-direction: column;
  padding: 0px;
  transition: 200ms;
  transform: translateX(140px);
}
header nav a {
  font-family: "Montserrat", sans-serif;
  text-decoration: none;
  color: #ebe8e8;
  font-size: 20px;
  padding: 20px;
  margin: 0px;
  transition: 200ms;
  width: 100%;
}
header nav a:hover {
  background: #201e1e;
}
header nav.active {
  transform: translateX(0px);
}

#topButton {
